// JobStickerPDF.js
import React, { forwardRef, useImperativeHandle } from "react";
import jsPDF from "jspdf";
import "jspdf-autotable";
import logo from "../../assets/images/srcc.png"; // Ensure this path is correct

const JobStickerPDF = forwardRef(({ jobData, data }, ref) => {
  useImperativeHandle(ref, () => ({
    /**
     * Generates the PDF and opens it in a new browser tab.
     */
    generatePdf: () => {
      try {
        // 1. Initialize jsPDF
        const doc = new jsPDF({
          orientation: "p",
          unit: "pt",
          format: "a4",
        });

        const pageWidth = doc.internal.pageSize.getWidth();
        const pageHeight = doc.internal.pageSize.getHeight();

        // Define margins
        const leftMargin = 40;
        const rightMargin = 40;
        const topMargin = 40;
        const bottomMargin = 40;

        // Calculate available width
        const availableWidth = pageWidth - leftMargin - rightMargin;
        const base64Sticker =
          "data:image/jpeg;base64,";
        // 2. Add LOGO + Title
        const img = new Image();
        img.src = base64Sticker;

        img.onload = () => {
          // Add "JOB NO. AMD/IMP/SEA/{job_no}/{year}" top-centered
          const jobNumberText = `JOB NO. AMD/IMP/SEA/${data.job_no}/${data.year}`;
          doc.setFontSize(16);
          doc.setFont("helvetica", "bold");
          const jobNumberWidth = doc.getTextWidth(jobNumberText);
          const jobNumberX = (pageWidth - jobNumberWidth) / 2;
          const jobNumberY = topMargin + 15;
          doc.text(jobNumberText, jobNumberX, jobNumberY);

          // Calculate and add the logo below the Job Number
          const aspectRatio = img.height / img.width;
          const logoWidth = availableWidth;
          const logoHeight = logoWidth * aspectRatio;
          const logoX = leftMargin;
          const logoY = jobNumberY + 20;
          doc.addImage(img, "JPEG", logoX, logoY, logoWidth, logoHeight);

          // Current vertical position after the logo
          let currentY = logoY + logoHeight + 30; // Space below the logo

          /**
           * Helper function to add a row with 2 columns (label/value pairs)
           */
          const addTwoColumnRow = (label1, value1, label2, value2) => {
            const labelWidth = 100; // fixed width for labels
            const gap = 20; // space between columns

            // First Column
            doc.setFontSize(12);
            doc.setFont("helvetica", "bold");
            doc.text(`${label1}:`, leftMargin, currentY);
            doc.setFont("helvetica", "normal");
            doc.text(`${value1}`, leftMargin + labelWidth + 10, currentY);

            // Second Column
            doc.setFont("helvetica", "bold");
            doc.text(
              `${label2}:`,
              leftMargin + availableWidth / 2 + gap,
              currentY
            );
            doc.setFont("helvetica", "normal");
            doc.text(
              `${value2}`,
              leftMargin + availableWidth / 2 + gap + labelWidth + 10,
              currentY
            );

            // Draw a horizontal line for the row border
            doc.setLineWidth(0.5);
            doc.line(
              leftMargin,
              currentY + 5,
              pageWidth - rightMargin,
              currentY + 5
            );

            currentY += 25;
          };

          /**
           * Helper function to add a row with 1 column (label/value)
           */
          const addSingleColumnRow = (label, value) => {
            const labelWidth = 100;

            doc.setFontSize(12);
            doc.setFont("helvetica", "bold");
            doc.text(`${label}:`, leftMargin, currentY);
            doc.setFont("helvetica", "normal");
            doc.text(`${value}`, leftMargin + labelWidth + 10, currentY);

            // Horizontal line
            doc.setLineWidth(0.5);
            doc.line(
              leftMargin,
              currentY + 5,
              pageWidth - rightMargin,
              currentY + 5
            );

            currentY += 25;
          };
          // --- Data Fallback Helpers ---
          // If jobData.field is missing, fallback to data.field, else N/A
          const getField = (field) =>
            jobData?.[field] ?? data?.[field] ?? "N/A";
          // 3. Add Rows for Job Details
          const containerList =
            jobData?.container_nos?.length > 0
              ? jobData.container_nos
              : data?.container_nos?.length > 0
              ? data.container_nos
              : null;
          // Row: Importer (1 column)
          addSingleColumnRow("Importer", data.importer || "N/A");

          // Row: BE No & BE Date (2 columns)
          // Row: BE No & BE Date
          addTwoColumnRow(
            "BE No",
            getField("be_no"),
            "BE Date",
            getField("be_date")
          );

          // Row: Invoice No & Invoice Date (2 columns)
          addTwoColumnRow(
            "Invoice No",
            data.invoice_number || "N/A",
            "Invoice Date",
            data.invoice_date || "N/A"
          );

          // Row: Loading Port & Packages
          addTwoColumnRow(
            "Loading Port",
            data.loading_port || "N/A",
            "Packages",
            data.no_of_pkgs || "N/A"
          );

          // Row: Description (1 column)
          addSingleColumnRow("Description", getField("description"));

          // Row: Gross Weight & Net Weight
          addTwoColumnRow(
            "Gross Weight",
            getField("gross_weight"),
            "Net Weight",
            getField("job_net_weight")
          );

          // Row: Gateway IGM & Date
          addTwoColumnRow(
            "Gateway IGM",
            data.gateway_igm || "N/A",
            "Gateway IGM Date",
            data.gateway_igm_date || "N/A"
          );

          // Row: Local IGM No & Local IGM Date
          addTwoColumnRow(
            "Local IGM No",
            data.igm_no || "N/A",
            "Local IGM Date",
            data.igm_date || "N/A"
          );

          // Row: BL No & BL Date
          addTwoColumnRow(
            "BL No",
            data.awb_bl_no || "N/A",
            "BL Date",
            data.awb_bl_date || "N/A"
          );

          // Row: Shipping Line & ICD
          addTwoColumnRow(
            "Shipping Line",
            data.shipping_line_airline || "N/A",
            "ICD",
            data.custom_house || "N/A"
          );

          // 4. Container Details
          currentY += 10;
          doc.setFontSize(14);
          doc.setFont("helvetica", "bold");
          doc.text("Container Details", leftMargin, currentY);
          currentY += 20;

          // Prepare Container data for autoTable
          const containerColumns = [
            { header: "Container No", dataKey: "container_number" },
            { header: "Size", dataKey: "size" },
            { header: "Seal Number", dataKey: "seal_number" },
          ];

          // If no containers, return a "No containers" row
          const containerData = containerList
            ? containerList.map((container) => ({
                container_number: container?.container_number || "N/A",
                size: container?.size || "N/A",
                seal_number: container?.seal_number || "N/A",
              }))
            : [
                {
                  container_number: "No containers available.",
                  size: "",
                  seal_number: "",
                },
              ];

          doc.autoTable({
            startY: currentY,
            head: [containerColumns.map((col) => col.header)],
            body: containerData.map((row) => [
              row.container_number,
              row.size,
              row.seal_number,
            ]),
            styles: { fontSize: 12, cellPadding: 5 },
            headStyles: {
              fillColor: [52, 58, 64],
              textColor: 255,
              fontStyle: "bold",
              halign: "center",
            },
            bodyStyles: {
              halign: "center",
            },
            columnStyles: {
              0: { cellWidth: 150 },
              1: { cellWidth: 100 },
              2: { cellWidth: 150 },
            },
            theme: "striped",
            alternateRowStyles: { fillColor: [248, 249, 250] },
            margin: { left: leftMargin, right: rightMargin },
          });

          // After table
          currentY = doc.lastAutoTable.finalY + 20;

          // Add page numbers in the footer
          const pageCount = doc.internal.getNumberOfPages();
          doc.setFontSize(10);
          for (let i = 1; i <= pageCount; i++) {
            doc.setPage(i);
            doc.text(
              `Page ${i} of ${pageCount}`,
              pageWidth / 2,
              pageHeight - 10,
              {
                align: "center",
              }
            );
          }

          // 5. Convert to Data URI and open in new tab
          const pdfDataUri = doc.output("datauristring");
          const newTab = window.open();
          if (newTab) {
            newTab.document.write(`
              <html>
                <head>
                  <title>Job Sticker PDF</title>
                  <style>
                    body, html {
                      margin: 0;
                      padding: 0;
                    }
                    iframe {
                      border: none;
                      width: 100%;
                      height: 100%;
                    }
                  </style>
                </head>
                <body>
                  <embed width="100%" height="100%" src="${pdfDataUri}" />
                </body>
              </html>
            `);
          } else {
            console.error("Failed to open new tab.");
            alert(
              "Pop-up blocked! Please allow pop-ups for this site to view the PDF."
            );
          }
        };

        img.onerror = (error) => {
          console.error("Error loading logo image:", error);
          alert("Failed to load logo image. Please try again.");
        };
      } catch (error) {
        console.error("Error generating PDF:", error);
        alert(`Error generating PDF: ${error.message}`);
      }
    },
  }));

  return null; // No need to render anything visually; this is purely for PDF generation
});

export default JobStickerPDF;
